import { useState } from 'react';
import { Plus, Search, Edit3, Trash2, Eye, Save, X, ArrowLeft } from 'lucide-react';
import { Button } from '../components/ui/button';
import { Input } from '../components/ui/input';
import { Textarea } from '../components/ui/textarea';
import { Card, CardContent, CardHeader, CardTitle } from '../components/ui/card';
import { Badge } from '../components/ui/badge';
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from '../components/ui/select';
import { Label } from '../components/ui/label';
import { Tabs, TabsContent, TabsList, TabsTrigger } from '../components/ui/tabs';
import { Dialog, DialogContent, DialogHeader, DialogTitle, DialogTrigger } from '../components/ui/dialog';
import { mockFaqs, mockCategories } from '../services/V1.Mockup.FAQ';
import { Link } from 'react-router-dom';

const FAQAdmin = () => {
  // Adaptar dados do V1.Mockup.FAQ para o formato esperado
  const adaptedFaqs = mockFaqs.filter(faq => faq.active).map(faq => ({
    id: faq.id.toString(),
    categoria: faq.categoryName,
    pergunta: faq.question,
    resposta: faq.answer,
    tags: faq.tags,
    status: 'ativo',
    prioridade: faq.priority === 'HIGH' ? 1 : faq.priority === 'MEDIUM' ? 2 : 3,
    autor: 'Admin',
    dataCreated: new Date(faq.createdAt),
    dataUpdated: new Date(faq.updatedAt),
    visualizacoes: faq.viewCount
  }));

  const adaptedCategorias = mockCategories.filter(cat => cat.active)
    .sort((a, b) => a.displayOrder - b.displayOrder)
    .map(cat => ({
      id: cat.id.toString(),
      nome: cat.name,
      descricao: cat.description,
      icone: cat.name === 'Conta' ? 'User' : cat.name === 'Pagamento' ? 'CreditCard' : cat.name === 'TÃ©cnico' ? 'Settings' : 'HelpCircle',
      ordem: cat.displayOrder,
      status: 'ativo'
    }));

  const [faqs, setFaqs] = useState(adaptedFaqs);
  const [categorias, setCategorias] = useState(adaptedCategorias);
  const [searchTerm, setSearchTerm] = useState('');
  const [editingFAQ, setEditingFAQ] = useState(null);
  const [editingCategoria, setEditingCategoria] = useState(null);
  const [isDialogOpen, setIsDialogOpen] = useState(false);
  const [isCategoryDialogOpen, setIsCategoryDialogOpen] = useState(false);

  const filteredFAQs = faqs.filter(faq =>
    faq.pergunta.toLowerCase().includes(searchTerm.toLowerCase()) ||
    faq.resposta.toLowerCase().includes(searchTerm.toLowerCase()) ||
    faq.categoria.toLowerCase().includes(searchTerm.toLowerCase()) ||
    faq.tags.some(tag => tag.toLowerCase().includes(searchTerm.toLowerCase()))
  );

  const handleSaveFAQ = (faqData) => {
    if (editingFAQ) {
      // Edit existing
      const updatedFAQ = {
        ...editingFAQ,
        ...faqData,
        dataUpdated: new Date()
      };
      setFaqs(faqs.map(f => f.id === editingFAQ.id ? updatedFAQ : f));
      console.log('FAQ atualizada com sucesso');
    } else {
      // Create new
      const newFAQ = {
        id: Date.now().toString(),
        categoria: faqData.categoria || '',
        pergunta: faqData.pergunta || '',
        resposta: faqData.resposta || '',
        tags: faqData.tags || [],
        status: faqData.status || 'ativo',
        prioridade: faqData.prioridade || 1,
        autor: faqData.autor || 'Admin',
        dataCreated: new Date(),
        dataUpdated: new Date(),
        visualizacoes: 0
      };
      setFaqs([...faqs, newFAQ]);
      console.log('FAQ criada com sucesso');
    }
    setEditingFAQ(null);
    setIsDialogOpen(false);
  };

  const handleDeleteFAQ = (id) => {
    setFaqs(faqs.filter(f => f.id !== id));
    console.log('FAQ removida com sucesso');
  };

  const handleSaveCategoria = (catData) => {
    if (editingCategoria) {
      // Edit existing
      const updatedCategoria = { ...editingCategoria, ...catData };
      setCategorias(categorias.map(c => c.id === editingCategoria.id ? updatedCategoria : c));
      console.log('Categoria atualizada com sucesso');
    } else {
